import React, { Component } from 'react';
import './Header.css';
import {BrowserRouter as Router, Switch, Link, Route} from 'react-router-dom';



class Header extends Component {
  render() {
    return (
      <div className="header-options">
        <div className="menu-buttons">
          <Router>


            <Link to="/recipes">Recipes</Link>
            <button className="recipes-button menu">Recipes</button>
            <button className="about-button menu">About</button>
            <button className="Newsletter-button menu">Newsletter</button>
            <button className="blizard-button blizzard-option menu">Blizzards</button>
            <button className="coupon-button menu">Coupons</button>
            <button className="contact-button menu">Contact</button>
            <button className="register-button menu">Register</button>
            <button className="login-button menu">Log-In</button>

          </Router>
        </div>
      </div>
    );
  }
}

export default Header;
